export default class Workout extends Component {

state = {
 showingFront: true,
 }



toggleShowingFront = () => {
    this.setState({
      showingFront: !this.state.showingFront
     })
     }




    render() {
        console.log(this.props.workout.exrcises)
        console.log(this.state.showingFront)
        return (


            <div onClick={this.toggleShowingFront}>
               <div>{this.state.showingFront? 
                    <div>{this.props.workout.name}
                         <br></br>
                         {this.props.workout.created_at}
                         <button>Delete</button>
                    </div>
                    :
                    <div>
                      <p> Exercise Details</p>
                      {this.props.workout.excercises}
                    </div>
                    }                
                </div>     



            </div>

        )
    }
}
